import React from 'react';
import {Nav, NavbarContainer, NavLogo} from './Navelements'

const NavigationBar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo href="/">Water Qualifiers</NavLogo>
                    <NavIcon>
                        <ThreeBarIco />
                    </NavIcon>
                    <NavigationMenu>
                        <NavigationItems>
                            <NavigationLinks to="about">About</NavigationLinks>
                        </NavigationItems>
                    </NavigationMenu>
                </NavbarContainer>
            </Nav>
        </>
    );
}

export default NavigationBar;
